import React from "react";
import "./App.css";

class App extends React.Component {
  render() {
    return (
      <div className="app">
        <div className="background-image"></div>
        <div className="fixed-svg"></div>
        <div className="footer">
          <h2>Footer Content</h2>
          <ul>
            <li>
              <a href="#">Link 1</a>
            </li>
            <li>
              <a href="#">Link 2</a>
            </li>
            <li>
              <a href="#">Link 3</a>
            </li>
          </ul>
          <div className="bubbles-container">
            {/* Bubble components */}
            <Bubble size={50} left={20} animationDelay={0} />
            <Bubble size={30} left={40} animationDelay={1} />
            <Bubble size={20} left={60} animationDelay={2} />
          </div>
        </div>
      </div>
    );
  }
}

class Bubble extends React.Component {
  render() {
    const { size, left, animationDelay } = this.props;
    const style = {
      width: size,
      height: size,
      left: left + "%",
      animationDelay: animationDelay + "s",
    };

    return <div className="bubble" style={style}></div>;
  }
}

export default App;
